  selector: 'app-card-repeater',
  templateUrl: './card-repeater.component.html',
  styleUrls: ['./card-repeater.component.css']
})
export class CardRepeaterComponent {

}
<div class="card" style="width: 18rem;">
    <img src={{img}} class="card-img-top" alt={{imgDescription}}>
    <div class="card-body">
      <h5 class="card-title">{{price}}</h5>
      <p class="card-text">{{description}}</p>
      <a href="#" class="btn btn-primary">Go somewhere</a>
    </div>
